import { Notifications } from "expo";
import React from "react";
// import { StackNavigator } from "react-navigation";
import LogInScreen from "../components/auth/LogInScreen";
import SignUpScreen from "../components/auth/SignupScreen";
import ForgotPasswordScreen from "../components/auth/ForgotPasswordScreen";
import { HomeScreen } from "../components/ScreenComponents";
import { createStackNavigator } from "@react-navigation/stack";

const RootStackNavigator = createStackNavigator();
// const RootStackNavigator = StackNavigator(
//   {
//     Login: { screen: LogInScreen },
//     Signup: { screen: SignUpScreen },
//     ForgotPassword: { screen: ForgotPasswordScreen },

//     Main: { screen: HomeScreen },
//   }
// {
//   navigationOptions = {
//     headerTitleStyle: {
//       fontWeight: "normal",
//     }
//   },
// }
// );

export default class RootNavigator extends React.Component {
  render() {
    return (
      <RootStackNavigator.Navigator>
        <RootStackNavigator.Screen name="Login" component={LogInScreen} />
        <RootStackNavigator.Screen name="Signup" component={SignUpScreen} />
        <RootStackNavigator.Screen
          name="ForgotPassword"
          component={ForgotPasswordScreen}
        />
        <RootStackNavigator.Screen name="Main" component={HomeScreen} />
      </RootStackNavigator.Navigator>
    );
  }
}
